import React from "react";
import Background from './nftttt.jpg';
import './App.css';

function Home() {
  return (
    <body className="home">
      <video autoplay muted loop id ='deneme'>
        <source src='https://www.youtube.com/embed/2Gg6Seob5Mg' type='vide/mp4'/>
      </video>
      <div className="container">
        <div className="row align-items-center my-5">
          <div className="col-lg-7">
          <img alt="Featured" class="shadow_image" src="https://lh3.googleusercontent.com/aXIeaukiZBG1OlIqkfo5j1Z63P060AlM2Qko9eIaN4s8UXPBDAGfErwSh4KrCAec6K23l8KOJQWeEcEmEOU5FFWAuO-Dg50wQlY4TCI=s550"/>
          </div>
          <div className="col-lg-5" style={{color:'white'}}>
            <h1 className="font-weight-light">Ana Sayfa</h1>
            <p>
                NFT Bazaar Türkiye'nin ilk NFT alım-satım platformudur
            </p>
          </div>
        </div>
      </div>
    </body>
  );
}

export default Home;
